exports=async function(bid,options){const{parseInfo}=await require("transcode/parse_info");return parseInfo("\u75AF\u60C5\u4E66\u5E93",`https://www.aabook.cc/m/book-${bid}.html`,[/<div class="left">\s*<a[^>]+>\s*<img src="(?<cover>[^"]*)"[^>]*>\s*<\/a>\s*<\/div>\s*<div class="right">\s*<h2>(?<name>[^<]+)<\/h2>\s*<p class="info">\s*(?:<br\s*\/>\s*)?作者：(?<author>[^<]+)</,/<span class="status[^"]*">(?<serial>[^<]+)</,/<div class="mod book-intro">\s*<div class="bd">(?<intro>[^<]+)/],{clientOptions:{...(options&&options.clientOptions)}})};